import React, { useState, useEffect } from 'react';
import axios from 'axios';

const AIDashboard = ({ user }) => {
  const [insights, setInsights] = useState(null);
  const [marketAnalysis, setMarketAnalysis] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAIInsights();
  }, []);

  const fetchAIInsights = async () => {
    try {
      // Fetch multiple AI insights
      const [insightsRes, marketRes] = await Promise.all([
        axios.get(`http://localhost:5001/api/ai/vendor-insights/vendor-123`).catch(() => null),
        axios.post('http://localhost:5001/api/ai/market-analysis', {
          category: 'IT Hardware',
          budget_range: 50000
        }).catch(() => null)
      ]);

      if (insightsRes?.data.success) {
        setInsights(insightsRes.data.insights);
      }
      if (marketRes?.data.success) {
        setMarketAnalysis(marketRes.data.analysis);
      }
    } catch (error) {
      console.error('Error fetching AI insights:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="ai-dashboard">
        <h2>🤖 AI Procurement Insights</h2>
        <div className="loading">Loading AI insights...</div>
      </div>
    );
  }

  return (
    <div className="ai-dashboard">
      <h2>🤖 AI Procurement Insights</h2>

      <div className="ai-insights-grid">
        {marketAnalysis && (
          <div className="insight-card">
            <h3>📈 Market Analysis</h3>
            <div className="market-metrics">
              <div className="metric">
                <label>Price Trend</label>
                <span className={`trend ${marketAnalysis.market_trends.average_price_trend}`}>
                  {marketAnalysis.market_trends.average_price_trend}
                </span>
              </div>
              <div className="metric">
                <label>Vendor Availability</label>
                <span>{marketAnalysis.market_trends.vendor_availability}</span>
              </div>
              <div className="metric">
                <label>Market Average</label>
                <span>${marketAnalysis.price_benchmarks.market_average.toLocaleString()}</span>
              </div>
            </div>
            <div className="market-recommendations">
              <h4>Recommendations</h4>
              {marketAnalysis.recommendations.map((rec, index) => (
                <div key={index} className="recommendation-item">
                  {rec}
                </div>
              ))}
            </div>
          </div>
        )}

        <div className="insight-card">
          <h3>🏆 AI Features Available</h3>
          <div className="features-list">
            <div className="feature-item">
              <span className="feature-icon">🤖</span>
              <div>
                <h4>Intelligent Vendor Evaluation</h4>
                <p>ML-powered quote analysis with risk assessment</p>
              </div>
            </div>
            <div className="feature-item">
              <span className="feature-icon">📋</span>
              <div>
                <h4>Contract Audit System</h4>
                <p>Automated contract review for risks and compliance</p>
              </div>
            </div>
            <div className="feature-item">
              <span className="feature-icon">📊</span>
              <div>
                <h4>Market Intelligence</h4>
                <p>Real-time market trends and pricing insights</p>
              </div>
            </div>
            <div className="feature-item">
              <span className="feature-icon">🎯</span>
              <div>
                <h4>Predictive Analytics</h4>
                <p>Forecast delivery times and cost trends</p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AIDashboard;
